Kompleks Bakı şəhərinin Yeni Baş Planına uyğun layihələndirilib və yerləşdiyi ərazinin 70%-i həyətyani sahə üçün nəzərdə tutulub.
Akhundov Residence layihəsinin özəllikləri:
• Avtomobilsiz həyət, yaşıllıq və uşaq meydançası;
• Blok meydançaların mərmər ilə üzlənməsi;
• Iki mərtəbəli yeraltı avtodayanacaqdan liftə çıxış;
• Hər girişdə 2 ədəd səssiz lift;
• 24/7 mühafizə xidməti;
• İçtimai nəqliyyat, ticarət və iaşə obyektlərinə yaxınlıq.

